drop schema if exists edit cascade;
create schema edit;

create table edit.category
(
    id          int  not null primary key,
    name_de     text not null,
    name_en     text not null,
    description text default null,
    editor_id   int
);

create table edit.tag
(
    id      int primary key generated always as identity,
    name_de text not null,
    name_en text not null
);

create table edit.poi
(
    id          int primary key generated always as identity,
    name        text not null,
    updated     date  default null,
    code        int   default null,
    idata       int   default null,
    fdata       float   default null,
    active      boolean,
    description text  default null,
    geom        geometry(Point, 3857),
    category_id int
);

create table edit.poi_small
(
    id          int primary key generated always as identity,
    name        text not null,
    updated     date  default null,
    code        int   default null,
    idata       int   default null,
    fdata       float   default null,
    active      boolean,
    description text  default null,
    geom        geometry(Point, 3857),
    category_id int
);

create table edit.tagging
(
    poi_id int,
    tag_id int
);

create table edit.district
(
    sid          text not null primary key,
    name         text not null,
    description  text default null,
    updated_at   date  default '2000-01-01',
    updated_by   text default '',
    geom         geometry(MultiPolygon, 3857)
);

create table edit.district_photo
(
    sid          text not null primary key,
    name         text default '',
    description  text default null,
    updated_at   date  default '2000-01-01',
    updated_by   text default '',
    photo_1 text,
    photo_img_1  bytea,
    photo_2 text,
    photo_img_2  bytea,
    photo_3 text,
    photo_img_3  bytea,
    geom         geometry(MultiPolygon, 3857)
);

create table edit.water
(
    id      int primary key generated always as identity,
    name    text,
    geom    geometry(MultiPolygon, 3857)
);

create table edit.park
(
    id     int primary key generated always as identity,
    name   text,
    fclass text,
    geom   geometry(MultiPolygon, 3857)
);

create table edit.thing
(
    id     int primary key generated always as identity,

    title    text,
    message  text,
    code     text,

    int1 int,
    int2 int,
    int3 int,
    int4 int,

    date1 date,
    date2 date
);

create table edit.person
(
    id            int primary key generated always as identity,
    name          text not null,
    login         text,
    passwd        text,
    token         text,
    description   text default null,
    poi_id        int,
    district_name text
);

create table edit.document
(
    id           int primary key generated always as identity,
    title        text default null,
    description  text default null,
    poi_id       int,
    filename     text not null,
    content      bytea
);


