update edit.poi
set updated=current_date - id,
    code=(id % 4) * 100,
    idata=id * 997,
    fdata=id * 3.1456,
    active=(id % 7 = 0)
;

-- https://pangrampangram.com/blogs/journal/best-pangrams-a-tool-for-every-graphic-designers

update edit.poi set description='Two driven jocks help fax my big quiz.' where id % 20 = 0;
